import React from "react";
import homeImage from "../images/home_image_one.png";
const Home = () => {
  return (
    <>
      <section id="banner">
        <div className="container" style={{height:'100%'}}>
          <div className="row">
            <div className="col-md-6 order-lg-1 order-2">
              <p className="promo-title">Grow your business with</p>
              <p>WE SHOWED UP</p>
              <p>We are a group of enthusiastic and crazy developers</p>
            </div>
            <div className="col-md-6 text-center order-lg-2 order-1">
              <img src={homeImage} alt="home image" className="img-fluid animated" />
            </div>
          </div>
        </div>  
      </section>
    </>
  );
};

export default Home;
